// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awListCommandRenderFunction } from 'js/AwListCommandService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwListCommandService', () => import('js/AwListCommandService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awListCommandRenderFunction",
            "deps": "js/AwListCommandService",
            "options": {
                "elementRefList": [
                    "cmdElement"
                ]
            }
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "ctx": {
        "clauseName": null
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "command": {
            "type": "object"
        },
        "vmo": {
            "type": "object"
        },
        "item-options": {
            "type": "object"
        }
    },
    "_viewModelId": "AwListCommand",
    "_uniqueViewModelId": "AwListCommand"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awListCommandRenderFunction, {"elementRefList":["cmdElement"]}, ctxImportObj );

export default Component;
